// src/components/InteractionList.js
import React, { useEffect, useState } from 'react';
import { getInteractions, deleteInteraction } from '../../api/interactionsApi';
import { Link } from 'react-router-dom';

const InteractionList = () => {
    const [interactions, setInteractions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    // Fetch interactions when the component is mounted
    useEffect(() => {
        const fetchInteractions = async () => {
            try {
                const fetchedInteractions = await getInteractions();
                setInteractions(fetchedInteractions);
            } catch (error) {
                setError('Error fetching interactions');
            } finally {
                setLoading(false);
            }
        };

        fetchInteractions();
    }, []);

    const handleDelete = async (interactionId) => {
        try {
            await deleteInteraction(interactionId);
            setInteractions((prevInteractions) =>
                prevInteractions.filter((interaction) => interaction._id !== interactionId)
            );
        } catch (error) {
            console.error('Error deleting interaction:', error);
            setError('Error deleting interaction');
        }
    };

    return (
        <div>
            <h1>Interactions</h1>
            {loading && <p>Loading interactions...</p>}
            {error && <p>{error}</p>}
            {!loading && interactions.length === 0 && <p>No interactions found.</p>}
            <ul>
                {interactions.map((interaction) => (
                    <li key={interaction._id}>
                        <Link to={`/interactions/${interaction._id}`}>{interaction.title}</Link>
                        <button onClick={() => handleDelete(interaction._id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default InteractionList;
